import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Header from "../pages/template/header/header";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Header}>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
